import logo from './logo.svg';
import './App.css';
import Header from "./component/header/Header"
import MyNavbar from './component/header/Navbar';
import CarouselComponent from './component/header/Carousel';
import ShortsCarousel from "./component/header/Teamcard";
import Fpoa from "./component/hero/Fpoa";
import Card from './component/hero/Card';




// import card1 from './asstes/images/iplslider2.jpg'




function App() {

 const cardData = [
    {
      id: 1,
      title: 'Starlit Night',
      description: 'A peaceful night under a sky full of stars.',
      image: 'https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=600&q=80',
    },
    {
      id: 2,
      title: 'Morning Bliss',
      description: 'Sunlight gently kissing the earth.',
      image: 'https://images.unsplash.com/photo-1500534623283-312aade485b7?auto=format&fit=crop&w=600&q=80',
    },
    {
      id: 3,
      title: 'Snowy Silence',
      description: 'A calm snowy landscape full of peace.',
      image: 'https://images.unsplash.com/photo-1519681393784-d120267933ba?auto=format&fit=crop&w=600&q=80',
    },
  ];

  return (
    <div>
    <Header/>  
    <MyNavbar/>
    <CarouselComponent/> 
    <div className="min-h-screen bg-[#0D1126] flex items-center justify-center p-6">
      <ShortsCarousel />
    </div>
    <Fpoa/>
    {/* <Card/> */}
     <div className="card-container">
      {cardData.map((card) => (
        <Card
          key={card.id}
          title={card.title}
          description={card.description}
          image={card.image}
        />
      ))}
    </div>
    </div>
  );
}

export default App;
